                                    <ul class="sc-jgbSNz ednPfV">
                                        <li class="sc-gSAPjG giMcXM"><span>
                                                <div>Oferecer produtos, serviços e/ou benefícios oferecidos pelas
                                                    plataformas do Mercado Livre (Mercado Livre, Mercado Pago, Mercado
                                                    Crédito, Mercado Envios, Mercado Livre Classificados, Mercado Livre
