                                            </span></li>
                                        <li class="sc-gSAPjG giMcXM"><span>
                                                <div>Aprimorar nossos serviços, desenvolver novos serviços e oferecer
                                                    uma melhor experiência no ecossistema do Mercado Livre.</div>
                                            </span></li>
