                                                class="black-link" target="_blank">você pode modificar suas preferências
                                                de cookies pela seção de privacidade</a>. As alterações que você fizer
                                            serão aplicadas a todos os navegadores que você usar para acessar sua
                                            conta.<br><br>Observe que se você alterar suas preferências de cookies sem
                                            acessar sua conta, elas ficarão salvas somente nesse navegador. É provável
                                            que você veja nosso aviso de uso de cookies novamente se usar outro
                                            navegador ou dispositivo.</div>
                                    </div>
                                    <div class="sc-kgUAyh dbQSLE">
